    number: '6'
    value: 'When receiving a contribution, Fundraising Coordinators must provide Form-003
      to the contributor. Form establishes that this candidacy is a federal campaign
      subject to compliance with the FECA and regulations of the FEC and the law requires
      us to register the personal information of our contributors. Form-003 requires:
      Name, Mailing Address, Phone Number, ID Number, if the person is US citizen
      or legal resident (Gren Card), occupation, employer, if self-employed, the name
      of the company, date and email. The staffer must revise the forms and complete
      a report for compliance staff within 24 hours after the contribution. Compliance
      staff must revise the report and return it to the Fundraising Coordinator with
      the findings on 24 hours. The fundraising staffer must correct the report by
      contacting the contributor by email, phone or mail asking for the missing information
      on 24 hours. If staffer is unable to contact the contributor, must contact the
      fundraising organizer and ask for other contact info of the contributor. The
      fundraising coordinator must make a second effort to contact the contributor
      by email, phone or mail and report the information within 7 days. Compliance
      division and fundraising division must have follow-up sessions weekly to review
      the missing information status. Cox Alomar 2012, Inc. continues the efforts
      to complete the contributor''s missing information.

